import React from 'react';
import '../styles.css';
import PageSetup from '../components/pageSetup';

const home = ({navBar}) => { 
    return(<PageSetup generalTitle="Raide Energy" pageTitle="Home">
        <div style={{textAlign: "center", fontSize: "20px", position: "relative", top: "400px"}}>
            {"Nuestra compañía se especializa en la fabricación de generadores eólicos y de paneles fotovoltaicos."}
        </div>
    </PageSetup>) 
}

export default home;
